import { Box } from '@mui/material';

import startIcon from '../../assets/img/starIcon.png'

const InformationCard = ({ superHost, type, title, beds, rating }) => {

    if (superHost === false) {
      (superHost = null)
    } else if 
      (superHost === true) {
      (superHost = <Box component="span" sx={{
        display: 'flex',
        alignItems: 'center',
        justifyContent:'center',
        width: '100px',
        height: '20px',
        fontSize: '14px',
        fontFamily: 'Monserrate',
        border: '1px solid #D7137F',
        borderRadius: '25px',
      }}>
      SUPER HOST</Box>)
    }

    return (
      <Box
        sx={{
          height: '80px',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'space-around',
          alignContent: 'space-between',
          alignItems:'flex-start',
        }}
      >
        <Box
          sx={{
            display: 'flex',
            width: '395px',
            justifyContent: 'space-between',
            alignContent: 'center',
            alignItems: 'center',
          }}
        >
          <span component="span" sx={{
          alignContent: 'center',
        }}>
            {superHost}
            </span>
            <span> {type} </span> 
            <span> {beds > 0 && <>. {beds} beds</>} </span> 
            <span>
              <img src={startIcon} alt="Rating with start icon" srcset="" />{rating}
            </span>
            <div className="rating-container">
          </div>
        </Box>
        <div className="title">
          {title}
        </div>
      </Box>
    );
  };

  export default InformationCard;
